def get_best_policy(q_table, cheat=False):
    policy: list = []
    for state in q_table:
        a = np.argmax(state)
        policy.append(a)
    return policy


def get_best_policy_osi(pso_nn, env):
    # return pso_nn.best_individual
    policy: list = []
    for state in range(env.observation_space.n):
        a = np.argmax(pso_nn.best_individual.predict(np.identity(env.observation_space.n)[state:state + 1]))
        policy.append(a)
    return policy


def get_best_path(q_table):
    policy = []
    if len(q_table) == 192:
        policy = [0]
        policy += [1]*11
        policy += [2]
        return policy
    elif len(q_table) == 768:
        policy = [0]*2
        policy += [1]*23
        policy += [2]*2
        return policy
    elif len(q_table) == 3072:
        policy = [0]*4
        policy += [1]*47
        policy += [2]*4
        return policy
    elif len(q_table) == 12288:
        policy = [0]*8
        policy += [1]*95
        policy += [2]*8
    return policy

